import React from "react";
import Link from "next/link";
import { Button } from "antd";

const Train = () => {
  return (
    <>
      <div
        style={{
          padding: "0 calc(100% / 18 * 2)",
          marginTop: 84,
        }}
      >
        <div>
          <h1>New Project</h1>
        </div>
        <div>
          <Button></Button>
        </div>
        <Link href="/train/audio">오디오</Link>
        <Link href="/train/image">이미지</Link>
        <Link href="/train/pose">포즈</Link>
      </div>
    </>
  );
};

export default Train;
